import React from 'react';
import '../../css/virtual/part1.css';

function Part2({ showTable }) {
    return (
        <section className="part" id="part2">
            <div className="graph"></div>
            <div className="button-line">
                <button onClick={() => showTable('table')}>표</button>
                <button onClick={() => showTable('news')}>뉴스</button>
            </div>
            <div className={showTable === 'table' ? 'table' : 'news'}></div>
        </section>
    );
}

export default Part2;
